import React from "react";
import { signOut } from "firebase/auth";
import { auth } from "../firebase";

function Home(){
    const handleSignOut = ()=>{
        signOut(auth).catch((err)=>{
            alert(err.message);
        })
    }
    return (
        <div>
            <h1>Firebase Works at last</h1>
            <button onClick={handleSignOut}>Sign Out</button>
        </div>
    )
}

export default Home;
